import React, { useState } from 'react';

const HomePage = () => {
  // –î–∞–Ω–Ω—ã–µ –æ–± —É—Å–ª—É–≥–∞—Ö
  const services = [
    {
      emoji: 'ü§ñ',
      title: '–ß–∞—Ç-–±–æ—Ç—ã',
      description: '–ê–≤—Ç–æ–º–∞—Ç–∏–∑–∏—Ä—É—é –æ–±—â–µ–Ω–∏–µ —Å –∫–ª–∏–µ–Ω—Ç–∞–º–∏, —Å–±–æ—Ä –∑–∞—è–≤–æ–∫ –∏ –∫–æ–Ω—Å—É–ª—å—Ç–∞—Ü–∏–∏ —á–µ—Ä–µ–∑ Telegram, WhatsApp –∏ –¥—Ä—É–≥–∏–µ –º–µ—Å—Å–µ–Ω–¥–∂–µ—Ä—ã.',
      value: '–î–ª—è –≤–∞—Å: —ç–∫–æ–Ω–æ–º–∏—è –≤—Ä–µ–º–µ–Ω–∏ –Ω–∞ —Ä—É—Ç–∏–Ω–Ω—ã—Ö –æ—Ç–≤–µ—Ç–∞—Ö, –∫—Ä—É–≥–ª–æ—Å—É—Ç–æ—á–Ω–∞—è —Ä–∞–±–æ—Ç–∞, —É–≤–µ–ª–∏—á–µ–Ω–∏–µ –∫–æ–Ω–≤–µ—Ä—Å–∏–∏ –∑–∞—è–≤–æ–∫.'
    },
    {
      emoji: 'üé•',
      title: '–ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã',
      description: '–°–æ–∑–¥–∞—é –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏–µ –≤–µ–±–∏–Ω–∞—Ä—ã, –∫–æ—Ç–æ—Ä—ã–µ –ø—Ä–æ–¥–∞—é—Ç 24/7 –±–µ–∑ –≤–∞—à–µ–≥–æ —É—á–∞—Å—Ç–∏—è.',
      value: '–î–ª—è –≤–∞—Å: –ø–∞—Å—Å–∏–≤–Ω—ã–π –ø–æ—Ç–æ–∫ –∫–ª–∏–µ–Ω—Ç–æ–≤, –º–∞—Å—à—Ç–∞–±–∏—Ä–æ–≤–∞–Ω–∏–µ —ç–∫—Å–ø–µ—Ä—Ç–∏–∑—ã, —Å–Ω–∏–∂–µ–Ω–∏–µ –∑–∞—Ç—Ä–∞—Ç –Ω–∞ –ø—Ä–æ–≤–µ–¥–µ–Ω–∏–µ –∂–∏–≤—ã—Ö –≤–µ–±–∏–Ω–∞—Ä–æ–≤.'
    },
    {
      emoji: 'üöÄ',
      title: '–ó–∞–ø—É—Å–∫–∏',
      description: '–ö–æ–º–ø–ª–µ–∫—Å–Ω–∞—è —Ç–µ—Ö–Ω–∏—á–µ—Å–∫–∞—è —Ä–µ–∞–ª–∏–∑–∞—Ü–∏—è –∑–∞–ø—É—Å–∫–æ–≤ –æ–Ω–ª–∞–π–Ω-–∫—É—Ä—Å–æ–≤, –º–∞—Ä–∞—Ñ–æ–Ω–æ–≤ –∏ –ø—Ä–æ–≥—Ä–∞–º–º.',
      value: '–î–ª—è –≤–∞—Å: –Ω–∞–¥–µ–∂–Ω–∞—è —Ç–µ—Ö–ø–æ–¥–¥–µ—Ä–∂–∫–∞ –∑–∞–ø—É—Å–∫–∞, –º–∏–Ω–∏–º–∏–∑–∞—Ü–∏—è —Ç–µ—Ö–Ω–∏—á–µ—Å–∫–∏—Ö —Å–±–æ–µ–≤, –∞–≤—Ç–æ–º–∞—Ç–∏–∑–∞—Ü–∏—è –ø—Ä–æ—Ü–µ—Å—Å–æ–≤ –ø—Ä–æ–¥–∞–∂.'
    },
    {
      emoji: 'üíª',
      title: '–¢–µ—Ö–ø–æ–¥–¥–µ—Ä–∂–∫–∞',
      description: '–ü–æ—Å—Ç–æ—è–Ω–Ω–æ–µ —Å–æ–ø—Ä–æ–≤–æ–∂–¥–µ–Ω–∏–µ –∏ —Ä–∞–∑–≤–∏—Ç–∏–µ –≤–∞—à–∏—Ö digital-–ø—Ä–æ–¥—É–∫—Ç–æ–≤.',
      value: '–î–ª—è –≤–∞—Å: —Å—Ç–∞–±–∏–ª—å–Ω–∞—è —Ä–∞–±–æ—Ç–∞ —Å–∏—Å—Ç–µ–º, –æ–ø–µ—Ä–∞—Ç–∏–≤–Ω–æ–µ —Ä–µ—à–µ–Ω–∏–µ –ø—Ä–æ–±–ª–µ–º, –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç—å —Ñ–æ–∫—É—Å–∏—Ä–æ–≤–∞—Ç—å—Å—è –Ω–∞ –±–∏–∑–Ω–µ—Å–µ.'
    }
  ];

  const [activeService, setActiveService] = useState(null);

  return (
    <div style={{
      minHeight: 'calc(100vh - 70px)',
      background: 'linear-gradient(45deg, #380303 0%, #1a0000 100%)',
      padding: '20px',
      textAlign: 'center',
      color: 'white',
      fontFamily: '-apple-system, BlinkMacSystemFont, sans-serif'
    }}>
      <h1 style={{ 
        fontSize: '36px', 
        color: '#f30808',
        marginBottom: '20px',
        textShadow: '0 2px 4px rgba(0,0,0,0.5)'
      }}>
        üî• –¢–ï–•–ù–ò–ß–ï–°–ö–ò–ô –°–ü–ï–¶–ò–ê–õ–ò–°–¢
      </h1>
      
      <p style={{ 
        fontSize: '18px', 
        marginBottom: '30px',
        lineHeight: '1.5',
        opacity: '0.9'
      }}>
        –¢–µ—Ö-–ª–∏–¥ / Digital-—Ç–µ—Ö–Ω–æ–ª–æ–≥<br/>
        –ê–≤—Ç–æ–≤–µ–±–∏–Ω–∞—Ä—ã ‚Ä¢ –ß–∞—Ç-–±–æ—Ç—ã ‚Ä¢ –ö–æ–º–ø–ª–µ–∫—Å–Ω—ã–µ –∑–∞–ø—É—Å–∫–∏
      </p>

      {/* –ö–æ–Ω—Ç–µ–π–Ω–µ—Ä –¥–ª—è —É—Å–ª—É–≥ */}
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))',
        gap: '15px',
        marginBottom: '30px'
      }}>
        {services.map((service, index) => (
          <div
            key={index}
            style={{
              background: 'rgba(255, 255, 255, 0.1)',
              border: '1px solid rgba(255, 0, 0, 0.3)',
              padding: '20px 15px',
              borderRadius: '12px',
              cursor: 'pointer',
              transition: 'all 0.2s ease',
              position: 'relative',
              minHeight: '120px',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center'
            }}
            onClick={() => setActiveService(activeService === index ? null : index)}
            onTouchStart={() => setActiveService(activeService === index ? null : index)}
          >
            <div style={{ fontSize: '32px', marginBottom: '10px' }}>
              {service.emoji}
            </div>
            <div style={{ 
              fontSize: '16px', 
              fontWeight: 'bold',
              marginBottom: '5px'
            }}>
              {service.title}
            </div>
            
            {/* –í—Å–ø–ª—ã–≤–∞—é—â–∞—è –ø–æ–¥—Å–∫–∞–∑–∫–∞ –¥–ª—è –¥–µ—Å–∫—Ç–æ–ø–∞ */}
            <div style={{
              position: 'absolute',
              bottom: '100%',
              left: '50%',
              transform: 'translateX(-50%)',
              background: 'rgba(0, 0, 0, 0.9)',
              color: 'white',
              padding: '12px',
              borderRadius: '8px',
              fontSize: '14px',
              width: '280px',
              zIndex: '10',
              opacity: '0',
              visibility: 'hidden',
              transition: 'all 0.3s ease',
              marginBottom: '10px',
              border: '1px solid #f30808',
              pointerEvents: 'none',
              textAlign: 'left',
              display: 'none' // –î–ª—è –º–æ–±–∏–ª—å–Ω—ã—Ö —Å–∫—Ä—ã–≤–∞–µ–º, –∏—Å–ø–æ–ª—å–∑—É–µ–º –º–æ–¥–∞–ª–∫—É
            }}
            className="desktop-tooltip"
            >
              <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#f30808' }}>
                {service.title}
              </div>
              <div style={{ marginBottom: '8px' }}>
                {service.description}
              </div>
              <div style={{ 
                color: '#00ff00', 
                fontSize: '13px',
                borderTop: '1px solid #333',
                paddingTop: '8px'
              }}>
                <strong>–î–ª—è –≤–∞—Å:</strong> {service.value}
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* –ú–æ–¥–∞–ª—å–Ω–æ–µ –æ–∫–Ω–æ —Å –¥–µ—Ç–∞–ª—å–Ω–æ–π –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–µ–π –¥–ª—è –º–æ–±–∏–ª—å–Ω—ã—Ö */}
      {activeService !== null && (
        <div style={{
          position: 'fixed',
          top: '0',
          left: '0',
          right: '0',
          bottom: '0',
          background: 'rgba(0, 0, 0, 0.85)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          zIndex: '100',
          padding: '20px'
        }}
        onClick={() => setActiveService(null)}
        >
          <div style={{
            background: 'linear-gradient(135deg, #1a0000 0%, #380303 100%)',
            border: '2px solid #f30808',
            borderRadius: '16px',
            padding: '25px',
            maxWidth: '400px',
            width: '100%',
            color: 'white',
            position: 'relative'
          }}
          onClick={(e) => e.stopPropagation()}
          >
            <button
              onClick={() => setActiveService(null)}
              style={{
                position: 'absolute',
                top: '15px',
                right: '15px',
                background: 'none',
                border: 'none',
                color: '#fff',
                fontSize: '24px',
                cursor: 'pointer',
                width: '30px',
                height: '30px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                borderRadius: '50%',
                background: 'rgba(255, 0, 0, 0.3)'
              }}
            >
              √ó
            </button>
            
            <div style={{ fontSize: '48px', marginBottom: '15px' }}>
              {services[activeService].emoji}
            </div>
            
            <h2 style={{ 
              fontSize: '24px', 
              color: '#f30808',
              marginBottom: '15px'
            }}>
              {services[activeService].title}
            </h2>
            
            <div style={{ 
              marginBottom: '20px',
              lineHeight: '1.5',
              fontSize: '16px'
            }}>
              {services[activeService].description}
            </div>
            
            <div style={{
              background: 'rgba(0, 255, 0, 0.1)',
              border: '1px solid #00ff00',
              padding: '15px',
              borderRadius: '8px',
              fontSize: '15px',
              lineHeight: '1.5'
            }}>
              <strong style={{ color: '#00ff00' }}>–î–ª—è –≤–∞—Å:</strong>{' '}
              {services[activeService].value}
            </div>
            
            <button
              onClick={() => setActiveService(null)}
              style={{
                marginTop: '20px',
                background: 'rgba(243, 8, 8, 0.2)',
                border: '1px solid #f30808',
                color: 'white',
                padding: '12px 24px',
                borderRadius: '8px',
                fontSize: '16px',
                cursor: 'pointer',
                width: '100%',
                transition: 'all 0.3s'
              }}
              onMouseEnter={(e) => e.currentTarget.style.background = 'rgba(243, 8, 8, 0.4)'}
              onMouseLeave={(e) => e.currentTarget.style.background = 'rgba(243, 8, 8, 0.2)'}
            >
              –ü–æ–Ω—è—Ç–Ω–æ
            </button>
          </div>
        </div>
      )}

      {/* CSS –¥–ª—è –¥–µ—Å–∫—Ç–æ–ø–Ω—ã—Ö –ø–æ–¥—Å–∫–∞–∑–æ–∫ */}
      <style>{`
        @media (min-width: 768px) {
          .desktop-tooltip {
            display: block !important;
          }
          
          div[style*="minHeight: '120px'"]:hover .desktop-tooltip {
            opacity: 1 !important;
            visibility: visible !important;
          }
        }
        
        @media (max-width: 767px) {
          h1 {
            font-size: 28px !important;
          }
          
          div[style*="gridTemplateColumns"] {
            grid-template-columns: repeat(2, 1fr) !important;
          }
        }
      `}</style>
    </div>
  );
};

export default HomePage;
